		Corki:
			- Drawing E-Lock marker can now be disabled
		Ashe:
			- Drawing R killable text can now be disabled

	r0.08:
		Graves:
			- Initial release
		Lucian:
			- Now uses jungle monsters for Q
		Ashe:
			- Added option to disable skills under tower in lane clear
			- Multiple small fixes which I forgot :/

	r0.07
		Ashe:
			- Initial release
	
	r0.06:
		Corki:
			- Will no longer cast spells on turrets when selected with "Focus Selected Target" enabled in SAC
		Lucian:
			- Will no longer cast spells on turrets when selected with "Focus Selected Target" enabled in SAC
